description:
Предлагается в аренду склад 530 м2
В составе небольшого офисно-складского комплекса на Оболони (правый берег);

• По всему складу установлены стеллажи (нагрузка 1 т/м);
• Есть разгрузочная зона.
• Автономный склад, с одними воротами, и пожарным выходом;
• Установлены пожарная сигнализация и видеонаблюдение.
• Автомобильная рампа, грузовой лифт;
• Размер 530 кв.м.
• Очень сухой и утепленный, минимум расходов на коммунальные услуги;
• Удобный подъезд для легкового и грузового автотранспорта, включая
еврофуры. Рядом с новой Окружной дорогой на Оболони;
• Гостевой паркинг, въезд на территорию по собственной карте доступа через автоматические ворота;
• Видеонаблюдение, охрана, система управления доступом, сигнализация;
• Аренда помещения под склад – от собственника, без комиссионных;
• Возможность арендовать офисные и дополнительные складские помещения.
Опции для расширения и развития;
• Расположение ул. Семьи Шевкоплясов, 7 (бывшая Павла Дыбенко).
Оболонь, возле Эпицентра на Богатырской.
• Стоимость 200 грн/м без НДС.

Более подробно на нашем сайте: stolichnyi.kiev.ua
